import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

function Issues() {
  return (
    <StyledContainer>
      <Subnavigation title='Issues'>
        <SubnavItem to='all'>All</SubnavItem>
        <SubnavItem to='saved1'>Saved Issue 1</SubnavItem>
        <SubnavItem to='saved2'>Saved Issue 2</SubnavItem>
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

export default Issues;
